import React from 'react';
import { Button } from 'react-materialize';
import AdminModal from './AdminModal';

function TrgiggerButton() {
    return (
        <Button href="#modal1" className="modal-trigger">
            <AdminModal />
        </Button>
    )
}

export default TrgiggerButton;
